import{b as p}from"./route-block.b5bad31b.js";import{o as t,c as e,R as c}from"./main.4c38d59f.js";const s={class:"article"},r=c("<p>\u0426\u0435 \u0432\u0436\u0435 \u0432\u043E\u0441\u044C\u043C\u0430 \u043C\u0430\u0448\u0438\u043D\u0430, \u044F\u043A\u0430 \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0430 \u0434\u043E \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0437 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u044E \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u043E\u044E \u0432\u0456\u0434 \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u0456\u0432 \u2013 \u0446\u044C\u043E\u0433\u043E \u0440\u0430\u0437\u0443 \u0437\u0456\u0431\u0440\u0430\u043D\u043E 20 \u0442\u043E\u043D\u043D \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438, \u0449\u043E \u043D\u0430\u0437\u0435\u043C\u043D\u044B\u043C \u0448\u043B\u044F\u0445\u043E\u043C \u0434\u043E\u0441\u0442\u0430\u0432\u0438\u0442\u044C \u0444\u0443\u0440\u0430.</p><blockquote><p>\xAB\u0412\u0441\u0435 \u0446\u0435 \u2013 \u0437\u0430\u0441\u043E\u0431\u0438 \u043E\u0441\u043E\u0431\u0438\u0441\u0442\u043E\u0457 \u0433\u0456\u0433\u0456\u0454\u043D\u0438 \u0442\u0430 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0438 \u0445\u0430\u0440\u0447\u0443\u0432\u0430\u043D\u043D\u044F, \u0441\u0435\u0440\u0435\u0434 \u044F\u043A\u0438\u0445 \u043A\u043E\u043D\u0441\u0435\u0440\u0432\u0438, \u043C\u0430\u043A\u0430\u0440\u043E\u043D\u0438, \u0437\u0433\u0443\u0449\u0435\u043D\u0435 \u043C\u043E\u043B\u043E\u043A\u043E, \u0441\u0443\u0445\u043E\u0444\u0440\u0443\u043A\u0442\u0438. \u0413\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u0443 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0443 \u043F\u0440\u0438\u043D\u043E\u0441\u044F\u0442\u044C \u0437\u0432\u0438\u0447\u0430\u0439\u043D\u0456 \u0436\u0438\u0442\u0435\u043B\u0456 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0443. \u041A\u0440\u0456\u043C \u0446\u044C\u043E\u0433\u043E, \u0447\u0430\u0441\u0442\u0438\u043D\u0443 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0446\u044C\u043E\u0433\u043E \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0433\u043E \u0433\u0440\u0443\u0437\u0443 \u043D\u0430\u043C \u0434\u043E\u043F\u043E\u043C\u0456\u0433 \u0437\u0456\u0431\u0440\u0430\u0442\u0438 \u0431\u043B\u0430\u0433\u043E\u0434\u0456\u0439\u043D\u0438\u0439 \u0444\u043E\u043D\u0434 \xAB\u041F\u043E\u0437\u0438\u0442\u0438\u0432 Y\u043Ci\u0442\xBB</p><p>\u0428\u0442\u0430\u0431 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u043F\u0456\u0434\u0442\u0440\u0438\u043C\u043A\u0438</p></blockquote><p>\u0412\u0440\u0430\u0445\u043E\u0432\u0443\u044E\u0447\u0438 \u0446\u044E \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u043A\u0443 \u0433\u0440\u0443\u0437\u0443, \u0437\u0430\u0433\u0430\u043B\u043E\u043C \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u044F\u043C\u0438 \u0437\u0456\u0431\u0440\u0430\u043D\u043E \u0438 \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u043E \u0432\u0436\u0435 \u043C\u0430\u0439\u0436\u0435 200 \u0442\u043E\u043D\u043D \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438 \u0423\u043A\u0440\u0430\u0457\u043D\u0456.</p><blockquote><p>\xAB\u0406\u0437 \u0432\u043E\u0441\u044C\u043C\u0438 \u0444\u0443\u0440 \u043F\u2019\u044F\u0442\u044C \u0432\u0436\u0435 \u043F\u0440\u0438\u0431\u0443\u043B\u0438 \u0434\u043E \u0423\u043A\u0440\u0430\u0457\u043D\u0438, \u0456 \u0433\u0443\u043C\u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0430 \u0440\u043E\u0437\u043F\u043E\u0434\u0456\u043B\u0435\u043D\u0430 \u043C\u0456\u0436 \u0440\u0435\u0433\u0456\u043E\u043D\u0430\u043C\u0438, \u0449\u043E \u0457\u0457 \u043F\u043E\u0442\u0440\u0435\u0431\u0443\u044E\u0442\u044C, \u0434\u0432\u0456 \u0444\u0443\u0440\u0438 - \u0449\u0435 \u0432 \u0434\u043E\u0440\u043E\u0437\u0456, \u0456, \u043D\u0430\u0440\u0435\u0448\u0442\u0456, \u0432\u043E\u0441\u044C\u043C\u0443 \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u0438\u043B\u0438 \u0441\u044C\u043E\u0433\u043E\u0434\u043D\u0456. \u041C\u0438 \u0437\u0430\u043A\u043B\u0438\u043A\u0430\u0454\u043C\u043E \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u0456\u0432 \u043F\u0440\u0438\u043D\u043E\u0441\u0438\u0442\u0438 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0443 \u0443 \u0431\u0443\u0434\u044C-\u044F\u043A\u0438\u0439 \u0447\u0430\u0441. \u0414\u043B\u044F \u043D\u0430\u0441 \u0454 \u0432\u0430\u0436\u043B\u0438\u0432\u043E\u044E \u0431\u0443\u0434\u044C-\u044F\u043A\u0430 \u043F\u0456\u0434\u0442\u0440\u0438\u043C\u043A\u0430. \u041D\u0430\u043C \u0434\u043E\u043F\u043E\u043C\u0430\u0433\u0430\u0454 \u0443\u0432\u0435\u0441\u044C \u0441\u0432\u0456\u0442, \u0432 \u0442\u043E\u043C\u0443 \u0447\u0438\u0441\u043B\u0456 \u0439 \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u0456\xBB.</p><p>\u041F\u0435\u0442\u0440\u043E \u0412\u0440\u0443\u0431\u043B\u0435\u0432\u0441\u044C\u043A\u0438\u0439, \u043F\u043E\u0441\u043E\u043B \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0456</p></blockquote><p>\u0422\u0430\u043A\u043E\u0436 \u0440\u0430\u043D\u0456\u0448\u0435 \u0434\u043E \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0432\u0436\u0435 \u0432\u0438\u043B\u0456\u0442\u0430\u043B\u0438 8 \u0430\u0432\u0456\u0430\u0440\u0435\u0439\u0441\u0456\u0432 \u0441 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u044E \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u043E\u044E \u0432\u0456\u0434 \u043D\u0430\u0440\u043E\u0434\u0443 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0443 \u0438 3 \u0440\u0435\u0439\u0441\u0438 - \u0432\u0456\u0434 \u0443\u0440\u044F\u0434\u0443 \u0420\u041A.</p><blockquote><p>\xAB200 \u0442\u043E\u043D\u043D \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0433\u043E \u0433\u0440\u0443\u0437\u0443 \u0437\u0430 \u0434\u0432\u0430 \u043C\u0456\u0441\u044F\u0446\u0456 \u0432\u0456\u0439\u043D\u0438 \u2013 \u0446\u0435 \u0434\u0443\u0436\u0435 \u0431\u0430\u0433\u0430\u0442\u043E. \u0417\u0434\u0435\u0431\u0456\u043B\u044C\u0448\u043E\u0433\u043E \u0432\u0441\u0435 \u0437\u0456\u0431\u0440\u0430\u043D\u043E \u0437 \u043D\u0435\u0432\u0435\u043B\u0438\u043A\u0438\u0445 \u043F\u0430\u0440\u0442\u0456\u0439 \u0442\u043E\u0432\u0430\u0440\u0456\u0432, \u044F\u043A\u0456 \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u0456 \u043F\u0440\u0438\u043D\u043E\u0441\u044F\u0442\u044C \u043A\u043E\u0436\u0435\u043D \u0434\u0435\u043D\u044C, \u0440\u043E\u0431\u043B\u044F\u0447\u0438 \u0437\u0430\u043A\u0443\u043F\u043A\u0438 \u0432 \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u0430\u0445. \u0411\u0435\u0437 \u0446\u044C\u043E\u0433\u043E \u043C\u0438, \u0443\u043A\u0440\u0430\u0457\u043D\u0446\u0456, \u043F\u0440\u043E\u0441\u0442\u043E \u043D\u0435 \u0432\u0438\u0436\u0438\u043B\u0438 \u0431\xBB</p><p>\u041E\u043A\u0441\u0430\u043D\u0430 \u0412\u0440\u0443\u0431\u043B\u0435\u0432\u0441\u044C\u043A\u0430, \u0434\u0440\u0443\u0436\u0438\u043D\u0430 \u043F\u043E\u0441\u043B\u0430 \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0456</p></blockquote><p>\u0424\u0443\u0440\u044B \u0437 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u044E \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u043E\u044E \u0457\u0434\u0443\u0442\u044C \u0447\u0435\u0440\u0435\u0437 \u0442\u0435\u0440\u0438\u0442\u043E\u0440\u0456\u044E \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043D\u0443, \u0411\u043E\u043B\u0433\u0430\u0440\u0456\u0457, \u0422\u0443\u0440\u0446\u0456\u0457 \u0442\u0430 \u0420\u0443\u043C\u0443\u043D\u0456\u0457. \u0414\u043E\u0440\u043E\u0433\u0430 \u0437\u0430\u0439\u043C\u0430\u0454 \u043F\u0440\u0438\u0431\u043B\u0438\u0437\u043D\u043E \u0434\u0432\u0430 \u0442\u0438\u0436\u043D\u0456. \u041D\u0430 \u0442\u0435\u0440\u0438\u0442\u043E\u0440\u0456\u0457 \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0444\u0443\u0440\u0438 \u0434\u043E\u043F\u0440\u0430\u0432\u043B\u044F\u044E\u0442\u044C \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043A\u0443 \u0434\u043E \u0432\u0435\u043B\u0438\u043A\u0438\u0445 \u0445\u0430\u0431\u0456\u0432, \u0437\u043E\u043A\u0440\u0435\u043C\u0430, \u0444\u0443\u0440\u0430, \u044F\u043A\u0430 \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0430 \u0441\u044C\u043E\u0433\u043E\u0434\u043D\u0456, \u043F\u0440\u0438\u0431\u0443\u0434\u0435 \u0434\u043E \u0412\u0456\u043D\u043D\u0438\u0446\u0456. \u0422\u0443\u0434\u0438 \u043D\u0430\u0434\u0445\u043E\u0434\u0438\u0442\u044C \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0430 \u0437 \u0440\u0456\u0437\u043D\u0438\u0445 \u043A\u0440\u0430\u0457\u043D. \u0422\u0430\u043C \u0432\u043E\u043D\u0430 \u0441\u043E\u0440\u0442\u0443\u0454\u0442\u044C\u0441\u044F \u0442\u0430 \u0432\u0436\u0435 \u0440\u043E\u0437\u043F\u043E\u0434\u0456\u043B\u044F\u0454\u0442\u044C\u0441\u044F \u0437\u0433\u0456\u0434\u043D\u043E \u0437\u0430\u043F\u0438\u0442\u0456\u0432 \u0434\u043E \u0440\u0435\u0433\u0456\u043E\u043D\u0456\u0432. \u0406 \u043F\u043E\u0442\u0440\u0435\u0431\u0430 \u0446\u044F \u0442\u0456\u043B\u044C\u043A\u0438 \u0437\u0431\u0456\u043B\u044C\u0448\u0443\u0454\u0442\u044C\u0441\u044F.</p><blockquote><p>\xAB\u041F\u0440\u0438\u043D\u043E\u0441\u0438\u0442\u0438 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u0443 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0443 \u043C\u043E\u0436\u043D\u0430 - \u0456 \u043F\u043E\u0442\u0440\u0456\u0431\u043D\u043E - \u043A\u043E\u0436\u0435\u043D \u0434\u0435\u043D\u044C. \u0417\u0430\u0440\u0430\u0437 \u043F\u0435\u0440\u0435\u0432\u0430\u0436\u043D\u043E \u043F\u043E\u0442\u0440\u0456\u0431\u043D\u0456 \u0437\u0430\u0441\u043E\u0431\u0438 \u043E\u0441\u043E\u0431\u0438\u0441\u0442\u043E\u0457 \u0442\u0430 \u0434\u0438\u0442\u044F\u0447\u043E\u0457 \u0433\u0456\u0433\u0456\u0454\u043D\u0438, \u043C\u0435\u0434\u0438\u043A\u0430\u043C\u0435\u043D\u0442\u0438, \u043E\u0434\u044F\u0433 \u0442\u0430 \u0432\u0437\u0443\u0442\u0442\u044F \u0442\u0430 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0438 \u0445\u0430\u0440\u0447\u0443\u0432\u0430\u043D\u043D\u044F. \u041D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0432 \u0446\u0435\u0439 \u043C\u043E\u043C\u0435\u043D\u0442 \u0430\u043A\u0442\u0438\u0432\u043D\u043E \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u043C\u043E \u0437\u0431\u0456\u0440 \u0434\u0438\u0442\u044F\u0447\u0438\u0445 \u0440\u0435\u0447\u0435\u0439 \u0434\u043B\u044F \u0434\u0438\u0442\u044F\u0447\u0438\u0445 \u0431\u0443\u0434\u0438\u043D\u043A\u0456\u0432 \u0432 \u0423\u043A\u0440\u0430\u0457\u043D\u0456. \u0426\u0435 \u0431\u0456\u043B\u0438\u0437\u043D\u0430 \u0434\u043B\u044F \u0434\u0456\u0442\u0435\u0439 2-10 \u0440\u043E\u043A\u0456\u0432. \u041C\u043E\u0436\u043D\u0430 \u043F\u0440\u0438\u043D\u043E\u0441\u0438\u0442\u0438 \u0442\u0430\u043A\u043E\u0436 \u043A\u043E\u0440\u043C \u0434\u043B\u044F \u0442\u0432\u0430\u0440\u0438\u043D - \u0432 \u0423\u043A\u0440\u0430\u0457\u043D\u0456 \u0437\u0430\u0440\u0430\u0437 \u0432\u0435\u043B\u0438\u0447\u0435\u0437\u043D\u0430 \u043A\u0456\u043B\u044C\u043A\u0456\u0441\u0442\u044C \u043F\u0440\u0438\u0442\u0443\u043B\u043A\u0456\u0432 \u0434\u043B\u044F \u0442\u0432\u0430\u0440\u0438\u043D \u0437\u0430\u043B\u0438\u0448\u0438\u043B\u0438\u0441\u044F \u0431\u0435\u0437 \u0437\u0430\u0441\u043E\u0431\u0456\u0432 \u0434\u043E \u0456\u0441\u043D\u0443\u0432\u0430\u043D\u043D\u044F\xBB.</p><p>\u0410\u043A\u043D\u0456\u0454\u0442 \u0410\u043C\u0456\u0440\u043A\u0443\u043B\u043E\u0432, \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440 \u0428\u0442\u0430\u0431\u0430</p></blockquote><p>\u0417\u0430\u0440\u0430\u0437 \u043F\u0443\u043D\u043A\u0442\u0438 \u043F\u0440\u0438\u0439\u043E\u043C\u0443 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438 \u043F\u0440\u0430\u0446\u044E\u044E\u0442\u044C \u0432\u0436\u0435 \u0432 11 \u0440\u0435\u0433\u0456\u043E\u043D\u0430\u0445 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0443: \u0432 \u041A\u0430\u0440\u0430\u0433\u0430\u043D\u0434\u0456, \u0423\u0440\u0430\u043B\u044C\u0441\u044C\u043A\u0443, \u0421\u0435\u043C\u0435\u0457, \u0423\u0441\u0442\u044C-\u041A\u0430\u043C\u0435\u043D\u043E\u0433\u043E\u0440\u0441\u044C\u043A\u0443, \u0410\u043A\u0442\u0430\u0443, \u0422\u0443\u0440\u043A\u0435\u0441\u0442\u0430\u043D\u0456, \u0410\u0442\u0438\u0440\u0430\u0443, \u0415\u043A\u0456\u0431\u0430\u0441\u0442\u0443\u0437\u0456, \u0410\u043A\u0442\u043E\u0431\u0435, \u0410\u043B\u043C\u0430\u0442\u0438 \u0442\u0430 \u041D\u0443\u0440-\u0421\u0443\u043B\u0442\u0430\u043D\u0456. \u0410\u0434\u0440\u0435\u0441\u0438 \u043C\u043E\u0436\u043D\u0430 \u0434\u0456\u0437\u043D\u0430\u0442\u0438\u0441\u044F \u0437\u0430 \u0446\u0438\u043C \u043F\u043E\u0441\u0438\u043B\u0430\u043D\u043D\u044F\u043C. \u0412 \u0441\u0442\u043E\u043B\u0438\u0446\u0456 \u043F\u0443\u043D\u043A\u0442 \u043F\u0440\u0438\u0439\u043E\u043C\u0443 \u043F\u0440\u0430\u0446\u044E\u0454 \u043F\u0440\u0438 \u043F\u043E\u0441\u043E\u043B\u044C\u0441\u0442\u0432\u0456 \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0437\u0430 \u0430\u0434\u0440\u0435\u0441\u043E\u044E \u0432\u0443\u043B. \u0416\u0438\u043B\u0438\u043E\u0439, 12.</p><p>\u0406\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0456\u0439\u043D\u0430 \u0434\u043E\u0432\u0456\u0434\u043A\u0430 \u0449\u043E\u0434\u043E \u0428\u0442\u0430\u0431\u0443 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u043F\u0456\u0434\u0442\u0440\u0438\u043C\u043A\u0438 \u0423\u043A\u0440\u0430\u0457\u043D\u0438:</p><p>\u0412 \u0428\u0442\u0430\u0431\u0456 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u043F\u0456\u0434\u0442\u0440\u0438\u043C\u043A\u0438 \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0432\u0436\u0435 \u043F\u0440\u0430\u0446\u044E\u044E\u0442\u044C \u043F\u0440\u0438\u0431\u043B\u0438\u0437\u043D\u043E 670 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u0456\u0432, 120 \u0437 \u044F\u043A\u0438\u0445 - \u043D\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u043D\u0456\u0439 \u043E\u0441\u043D\u043E\u0432\u0456. \u041E\u043A\u0440\u0456\u043C \u043E\u0441\u043D\u043E\u0432\u043D\u043E\u0457 \u0434\u0456\u044F\u043B\u044C\u043D\u043E\u0441\u0442\u0456 \u2013 \u043F\u0440\u0438\u0439\u043E\u043C\u0443, \u0441\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F, \u0437\u0430\u0432\u0430\u043D\u0442\u0430\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u043A\u0438 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043A\u0438, \u0432 \u0428\u0442\u0430\u0431\u0456 \u0442\u0430\u043A\u043E\u0436 \u043F\u0440\u0430\u0446\u044E\u0454 \u0456\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0456\u0439\u043D\u0430 \u0441\u043B\u0443\u0436\u0431\u0430, \u0441\u043B\u0443\u0436\u0431\u0430 \u0444\u0430\u043D\u0434\u0440\u0430\u0439\u0437\u0438\u043D\u0433\u0443 \u0442\u0430 \u0441\u043B\u0443\u0436\u0431\u0430 \u0456\u0432\u0435\u043D\u0442\u0456\u0432. \u0412\u0441\u0456 \u043F\u0440\u0430\u0446\u044E\u044E\u0442\u044C \u0432\u0438\u043A\u043B\u044E\u0447\u043D\u043E \u043D\u0430 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u0441\u044C\u043A\u0438\u0445 \u0437\u0430\u0441\u0430\u0434\u0430\u0445 \u0437\u0430\u0440\u0430\u0434\u0438 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438 \u0443\u043A\u0440\u0430\u0457\u043D\u0446\u044F\u043C \u0432 \u0446\u0435\u0439 \u0441\u043A\u043B\u0430\u0434\u043D\u0438\u0439 \u0447\u0430\u0441.</p><p>\u0412 \u043F\u043B\u0430\u043D\u0430\u0445 \u0428\u0442\u0430\u0431\u0443 \u2013 \u0430\u043A\u0442\u0438\u0432\u043D\u0438\u0439 \u0440\u043E\u0437\u0432\u0438\u0442\u043E\u043A \u043D\u0430\u043F\u0440\u044F\u043C\u043A\u0443 \u0431\u043B\u0430\u0433\u043E\u0434\u0456\u0439\u043D\u0438\u0445 \u0456\u0432\u0435\u043D\u0442\u0456\u0432, \u0437\u043E\u043A\u0440\u0435\u043C\u0430 \u0431\u043B\u0430\u0433\u043E\u0434\u0456\u0439\u043D\u0438\u0445 \u044F\u0440\u043C\u0430\u0440\u043A\u0456\u0432, \u043A\u043E\u0448\u0442\u0438 \u0432\u0456\u0434 \u043F\u0440\u043E\u0434\u0430\u0436\u0443 \u0432\u0438\u0440\u043E\u0431\u0456\u0432 \u043D\u0430 \u044F\u043A\u0438\u0445 \u0431\u0443\u0434\u0443\u0442\u044C \u0441\u043F\u0440\u044F\u043C\u043E\u0432\u0430\u043D\u0456 \u043D\u0430 \u0437\u0430\u043A\u0443\u043F\u0456\u0432\u043B\u044E \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438 \u0434\u043B\u044F \u0443\u043A\u0440\u0430\u0457\u043D\u0446\u0456\u0432.</p><p>\u0422\u0430\u043A\u043E\u0436 \u0437\u0430\u043F\u0443\u0449\u0435\u043D\u043E \u0441\u043B\u0443\u0436\u0431\u0443 \u0440\u043E\u0431\u043E\u0442\u0438 \u0437 \u0431\u0456\u0436\u0435\u043D\u0446\u044F\u043C\u0438 \u0437 \u0423\u043A\u0440\u0430\u0457\u043D\u0438. \u041A\u043E\u043C\u0430\u043D\u0434\u0430 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u0456\u0432 \u0434\u043E\u043F\u043E\u043C\u0430\u0433\u0430\u0454 \u0443\u043A\u0440\u0430\u0457\u043D\u0446\u044F\u043C, \u0449\u043E \u043F\u0440\u0438\u0431\u0443\u043B\u0438 \u0434\u043E \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0443 \u043F\u0456\u0441\u043B\u044F \u043F\u043E\u0447\u0430\u0442\u043A\u0443 \u0432\u0456\u0439\u043D\u0438, \u0443 \u0432\u0438\u0440\u0456\u0448\u0435\u043D\u043D\u0456 \u0457\u0445 \u043F\u043E\u0431\u0443\u0442\u043E\u0432\u0438\u0445 \u043F\u0440\u043E\u0431\u043B\u0435\u043C, \u043D\u0430\u0434\u0430\u0454 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0443 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0443, \u0430 \u0442\u0430\u043A\u043E\u0436 \u043D\u0430\u0434\u0430\u0454 \u0431\u0443\u0434\u044C-\u044F\u043A\u0456 \u0456\u043D\u0448\u0456 \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0446\u0456\u0457 \u0449\u043E\u0434\u043E \u0430\u0434\u0430\u043F\u0442\u0430\u0446\u0456\u0457 \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0456. \u0423\u043A\u0440\u0430\u0457\u043D\u0446\u0456\u0432, \u044F\u043A\u0456 \u043F\u043E\u0442\u0440\u0435\u0431\u0443\u044E\u0442\u044C \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u0456\u0432, \u0437\u0430\u043A\u043B\u0438\u043A\u0430\u0454\u043C\u043E \u0441\u043C\u0456\u043B\u0438\u0432\u043E \u0437\u0432\u0435\u0440\u0442\u0430\u0442\u0438\u0441\u044F \u0434\u043E \u0428\u0442\u0430\u0431\u0443.</p>",13),l=[r],a={setup(i,{expose:o}){return o({frontmatter:{title:"\u041C\u0430\u0439\u0436\u0435 200 \u0442\u043E\u043D\u043D \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438 \u0432\u0436\u0435 \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u043E \u0437 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0443",description:"21 \u043A\u0432\u0456\u0442\u043D\u044F 2022 \u0440\u043E\u043A\u0443 \u0428\u0442\u0430\u0431 \u0433\u0443\u043C\u0430\u043D\u0456\u0442\u0430\u0440\u043D\u043E\u0457 \u043F\u0456\u0434\u0442\u0440\u0438\u043C\u043A\u0438 \u0423\u043A\u0440\u0430\u0457\u043D\u0438 \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0456 \u0432\u0456\u0434\u043F\u0440\u0430\u0432\u0438\u0432 \u0447\u0435\u0440\u0433\u043E\u0432\u0438\u0439 \u0432\u0430\u043D\u0442\u0430\u0436 \u0437 \u041D\u0443\u0440-\u0421\u0443\u043B\u0442\u0430\u043D\u0443."}}),(u,_)=>(t(),e("div",s,l))}};typeof p=="function"&&p(a);export{a as default};
